import { Card, Col, Row } from 'antd';

const RecipeCard = ({}) => {
    return (
        <Card 
            title="Card title" 
            bordered={false}
            cover={
                <img
                  alt="example"
                  src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
                />
              }
        >
            Card content
        </Card>
    )
}

export default RecipeCard;
